/* Меню */

.nav {
  position: absolute;
  right: 70px;
  top: 35px;
  display: flex;
  justify-content: space-between;
}

.nav ul {
  margin: auto -15px auto 0px;
  width: 845px;
  list-style: none;
  display: flex;
  justify-content: space-between;
  font-weight: 700;
  font-size: 22px;
  line-height: 25px;
  letter-spacing: 0.02em;
}

.li {
  padding: 0px;
}

.liAudio {
  display: none;
}

.burger {
  top: 35px;
  right: 19px;
  display: none;
  position: absolute;
  z-index: 50;
  align-items: center;
  justify-content: flex-end;
  width: 30px;
  height: 18px;
}

.burger span {
  height: 2px;
  width: 100%;
  transform: scale(1);
  background-color: #faf6f2;
}

.burger::before {
  content: "";
  position: absolute;
  height: 2px;
  width: 110%;
  background-color: #faf6f2;
  transition: all 0.3s ease 0s;
}

.burger::after {
  content: "";
  position: absolute;
  right: 0px;
  height: 2px;
  width: 110%;
  background-color: #faf6f2;
  transition: all 0.3s ease 0s;
}

.burger::before {
  top: 0;
}

.burger::after {
  bottom: 0;
}

/* Добавляем класс active для анимации иконки бургера */
.burger.active span {
  transform: scale(0);
}

.burger.active::before {
  top: 50%;
  transform: rotate(-45deg) translate(0, -50%);
}

.burger.active::after {
  bottom: 50%;
  transform: rotate(45deg) translate(0, 50%);
}

/* При разрешении экрана 1080px и ниже, выводим на экран иконку бургера */
