sources.style.css:
html {
  width: 100vw;
  max-width: 100%;
  overflow-x: hidden;
}

.body {
  padding: 0px;
  margin: 0px auto;
  background-color: #121212;
  color: #ffffff;
  font-family: "Arimo";
  display: flex;
  flex-direction: column;
  width: 100vw;
  max-width: 100%;
  overflow-x: hidden;
}

.body__gallery {
  padding: 0px;
  margin: 0px auto;
  background-color: #efefef;
  color: #262626;
  font-family: "Arimo";
  display: flex;
  flex-direction: column;
  width: 100vw;
  max-width: 100%;
  overflow-x: hidden;
}

* {
  padding: 0;
  margin: 0;
  box-sizing: border-box;
}

.wrapper {
  flex-grow: 1;
  height: 100px;
}

.open {
  display: flex !important;
}

.header {
  display: flex;
  align-items: center;
  justify-content: space-between;
  min-height: 100px;
  background-color: #121212;
  color: #faf6f2;
  padding: 0 40px;
  width: 375px;
  height: 100px;
  position: relative;
}

.header__gallery {
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: #121212;
  color: #faf6f2;
  margin: 0px 0px 0px 0px;
  padding: 0px 0px 0px 0px;
  width: 100%;
  height: 54px;
  position: relative;
}

@media (min-width: 1080px) {
  .header__gallery {
    display: flex;
    align-items: center;
    justify-content: space-between;
    background-color: #121212;
    color: #faf6f2;
    margin: 0px 0px 0px 0px;
    padding: 0px 0px 0px 0px;
    width: 100%;
    height: 50px;
    position: relative;
  }
}

.page-title {
  margin: 0px 0px 0px 100px;
  padding: 21px 0px 21px 0px;
  width: 332px;
  height: 100px;
  display: flex;
  justify-content: center;
  flex-direction: column;
  align-items: center;
  text-align: left center;
  font-weight: 400;
  font-size: 25px;
  line-height: 29px;
  text-transform: uppercase;
}

.page-title__gallery {
  margin: 19px 16px 12px 0px;
  padding: 0px 0px 0px 0px;
  font-weight: 700;
  font-size: 20px;
  line-height: 23px;
  display: inline-block;
  align-items: center;
  text-align: right;
  letter-spacing: 0.01em;
  text-transform: uppercase;
}

@media (min-width: 1080px) {
  .page-title__gallery {
    margin: 9px 100px 9px 0px;
    padding: 0px 0px 0px 0px;
    width: 275px;
    height: 32px;
    font-weight: 700;
    font-size: 28px;
    line-height: 32px;
    display: flex;
    align-items: center;
    letter-spacing: 0.01em;
    text-transform: uppercase;
  }
}

.back__gallery {
  margin: 10px 0px 10px 50px;
  padding: 0px 0px 0px 0px;
  font-weight: 400;
  font-size: 28px;
  line-height: 34px;
  text-align: right;
  letter-spacing: 0.01em;
  color: #ffffff;
  flex: none;
  display: inline-block;
}

@media (min-width: 1080px) {
  .back__gallery {
    margin: 8px 0px 8px 134px;
    padding: 0px 0px 0px 0px;
    width: 77px;
    height: 34px;
    font-weight: 400;
    font-size: 28px;
    line-height: 34px;
    text-align: right;
    letter-spacing: 0.01em;
  }
}

/* Меню */

.nav {
  position: absolute;
  right: 70px;
  top: 35px;
  display: flex;
  justify-content: space-between;
}

.nav ul {
  margin: auto -15px auto 0px;
  width: 845px;
  list-style: none;
  display: flex;
  justify-content: space-between;
  font-weight: 700;
  font-size: 22px;
  line-height: 25px;
  letter-spacing: 0.02em;
}

.li {
  padding: 0px;
}

.liAudio {
  display: none;
}

.burger {
  top: 35px;
  right: 19px;
  display: none;
  position: absolute;
  z-index: 50;
  align-items: center;
  justify-content: flex-end;
  width: 30px;
  height: 18px;
}

.burger span {
  height: 2px;
  width: 100%;
  transform: scale(1);
  background-color: #faf6f2;
}

.burger::before {
  content: "";
  position: absolute;
  height: 2px;
  width: 110%;
  background-color: #faf6f2;
  transition: all 0.3s ease 0s;
}

.burger::after {
  content: "";
  position: absolute;
  right: 0px;
  height: 2px;
  width: 110%;
  background-color: #faf6f2;
  transition: all 0.3s ease 0s;
}

.burger::before {
  top: 0;
}

.burger::after {
  bottom: 0;
}

/* Добавляем класс active для анимации иконки бургера */
.burger.active span {
  transform: scale(0);
}

.burger.active::before {
  top: 50%;
  transform: rotate(-45deg) translate(0, -50%);
}

.burger.active::after {
  bottom: 50%;
  transform: rotate(45deg) translate(0, 50%);
}

/* При разрешении экрана 1080px и ниже, выводим на экран иконку бургера */
@media (max-width: 1365px) {
  .wrapper {
    height: 86px;
    width: 100%;
    position: fixed;
    top: 0;
    background-color: #121212;
    z-index: 101;
  }

  .header {
    width: 375px;
    height: 86px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    min-height: 86px;
    background-color: #121212;
    color: #faf6f2;
    padding: 0 40px;
    position: relative;
  }

  .page-title {
    margin: 20px 0px 20px 16px;
    padding: 0px 0px 0px 0px;
    width: 290px;
    height: 46px;
    display: flex;
    justify-content: center;
    flex-direction: column;
    align-items: center;
    font-weight: 400;
    font-size: 20px;
    line-height: 23px;
    letter-spacing: 0.01em;
    text-transform: uppercase;
  }

  .burger {
    display: flex;
    position: fixed;
  }

  .nav {
    display: none;
    flex-direction: column;
    position: fixed;
    height: 300px;
    width: 100%;
    top: 80px;
    bottom: 0;
    left: 0;
    right: 0;
    z-index: 50;
    overflow-y: auto;
    padding: 20px;
    background-color: #121212;
    animation: burgerAnimation 0.4s;
  }

  .nav ul {
    width: 100%;
    list-style: none;
    display: flex;
    justify-content: flex-end;
    font-weight: 700;
    font-size: 22px;
    line-height: 25px;
  }

  .liAudio {
    display: block;
  }

  .nav ul {
    flex-direction: column;
    row-gap: 30px;
    align-items: center;
    font-weight: 700;
    font-size: 22px;
    line-height: 25px;
    letter-spacing: 0.02em;
    flex: none;
    order: 0;
